# use chrono::{DateTime, DurationRound, Duration, TimeZone, Utc, NaiveDate};
let dt = NaiveDate::from_ymd_opt(2018, 1, 11).unwrap().and_hms_milli_opt(12, 0, 0, 154).unwrap().and_local_timezone(Utc).unwrap();
assert_eq!(
